import React from 'react';
import "./navbar.css";
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import Box from '@mui/material/Box';
import Badge from '@mui/material/Badge';
import ChatBubbleOutlineIcon from '@mui/icons-material/ChatBubbleOutline';
import AppsIcon from '@mui/icons-material/Apps';
import SearchIcon from '@mui/icons-material/Search';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
 import MailIcon from "./mailIcon/MailIcon";
 import NotificationIcon from '../NotificationIcon/NotificationIcon';


function Navbar() {
   return (
    <div className="topbarContainer">
      <div className="topbarLeft">
        <img src="/assests/icon.jpg" alt="icon" className="img"/>
          <div className='topbarIcons'>
            <div className="topbarIconItem1">
                <FavoriteBorderIcon className='displayColorRed' />
            </div>
            <div className="topbarIconItem">
            <NotificationIcon  className='displayColor'/>
            </div>
            <div className="topbarIconItem">
            <MailIcon  className='displayColor'/>
            </div>
            <div className="topbarIconItem">
                <ChatBubbleOutlineIcon className='displayColor' />
            </div>
             <div className="topbarIconItem">
                <AppsIcon className='displayColor' />
            </div>
          </div>
       </div>

       <div className="topbarRight">
        <div className="searchbar">
          <SearchIcon className="searchIcon" />
          <input type="text" placeholder="Search" className="searchInput" />
        </div>
        <div className="topbarIconItem2">
          <Box sx={{ color: 'action.active' }}>
            <Badge color="secondary" variant="dot">
              <ShoppingCartIcon />
            </Badge>
          </Box>  
      </div>
        <Box sx={{ color: 'action.active' }}>
            <Badge color="secondary" variant="dot">
            <img src="/assests/jenna.jpg" alt="profile-icon" className="topbarImg"/>
            </Badge>
         </Box> 

       </div>

    </div>
);
  }

export default Navbar;
